import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the first product card to open the details modal
    // Using a class selector to find the first product
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the modal to be visible and take a screenshot
    // The modal contains the "Add to Wish List" button
    await page.waitForSelector('.add-to-wishlist', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button
    // Using getByRole for a more user-centric selection
    await page.getByRole('button', { name: 'Add to Wish List' }).click();

    // 4. Wait for the success notification and take a screenshot
    await page.waitForSelector('.notification.success', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    // 5. Extract the notification text to verify the action
    const notificationText = await page.locator('.notification.success').textContent();

    return {
      success: true,
      action: "Added a product to the wishlist and verified the confirmation message.",
      extractedData: {
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on failure if possible
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
